import * as React from "react";
import { useEffect, useState } from "react";

const imgBase64 =
  "data:image/png;base64,";

const canvasWidth = 300;
const canvasHeight = 300;
const magnifierWidth = 100;
const magnifierHeight = 100;
const magnifierScaleRatio = 10;

function ScreenColorPicker() {
  const [magnifier, setMagnifier] = useState<HTMLCanvasElement | null>();
  const [canvas, setCanvas] = useState<HTMLCanvasElement | null>();
  const [_offsetLeft, setOffsetLeft] = useState(0);
  const [_offsetTop, setOffsetTop] = useState(0);
  const [imgWidth, setImgWidth] = useState<number>(0);
  const [imgHeight, setImgHeight] = useState<number>(0);
  const [widthRatio, setWidthRatio] = useState<number>(1);
  const [heightRatio, setHeightRatio] = useState<number>(1);
  const [magnifierVisible, setMagnifierVisible] = useState(false);

  useEffect(() => {
    const _magnifier = document.getElementById(
      "magnifier"
    ) as HTMLCanvasElement | null;
    setMagnifier(_magnifier);
  }, []);

  const drawLine = (
    ctx: CanvasRenderingContext2D,
    stepX: number,
    stepY: number,
    width = magnifierWidth,
    height = magnifierHeight
  ) => {
    ctx.beginPath();
    ctx.strokeStyle = "black";
    ctx.lineWidth = 1;
    const initRatio = magnifierScaleRatio % 2 === 0 ? 0.5 : 1;
    for (let x = initRatio * stepX; x <= magnifierWidth; x += stepX) {
      ctx.moveTo(x, 0);
      ctx.lineTo(x, height);
    }
    for (let y = initRatio * stepY; y <= magnifierHeight; y += stepY) {
      ctx.moveTo(0, y);
      ctx.lineTo(width, y);
    }
    ctx.stroke();

    ctx.beginPath();
    ctx.strokeStyle = "red";
    debugger;
    const centerSquareStartX = ((magnifierScaleRatio - 1) / 2) * stepX;
    const centerSquareStartY = ((magnifierScaleRatio - 1) / 2) * stepY;
    ctx.moveTo(centerSquareStartX, centerSquareStartY);
    ctx.lineTo(centerSquareStartX + stepX, centerSquareStartY);
    ctx.lineTo(centerSquareStartX + stepX, centerSquareStartY + stepY);
    ctx.lineTo(centerSquareStartX, centerSquareStartY + stepY);
    ctx.lineTo(centerSquareStartX, centerSquareStartY);
    ctx.stroke();

    ctx.closePath();
  };

  const handleImageLoad = () => {
    const c = document.getElementById("c") as HTMLCanvasElement | null;
    setCanvas(c);
    const img = document.getElementById("sourceImg") as HTMLImageElement | null;
    const ctx = (c as HTMLCanvasElement).getContext("2d");
    // console.log("ctx: ", ctx);
    (window as any).ctx = ctx;
    if (img && ctx) {
      setImgWidth(img.naturalWidth);
      setImgHeight(img.naturalHeight);
      setWidthRatio(img.naturalWidth / canvasWidth);
      setHeightRatio(img.naturalHeight / canvasHeight);
      ctx.drawImage(
        img,
        0,
        0,
        img.naturalWidth,
        img.naturalHeight,
        0,
        0,
        300,
        300
      );
    }
  };
  const handleMouseMove = (
    e: React.MouseEvent<HTMLCanvasElement, MouseEvent>
  ) => {
    const canvas = e.target as HTMLCanvasElement;

    let offsetLeft = canvas.offsetLeft;
    let offsetTop = canvas.offsetTop;
    let parentEl: HTMLElement | null = canvas.offsetParent as HTMLElement;
    while (parentEl) {
      offsetLeft += parentEl.offsetLeft;
      offsetTop += parentEl.offsetTop;
      parentEl = parentEl.offsetParent as HTMLElement | null;
    }
    // console.log(e.pageX - offsetLeft, e.pageY - offsetTop);

    const [_offsetLeft, _offsetTop] = [
      e.pageX - offsetLeft,
      e.pageY - offsetTop,
    ];
    setOffsetLeft(_offsetLeft >= 0 ? _offsetLeft : 0);
    setOffsetTop(_offsetTop >= 0 ? _offsetTop : 0);

    const pX = (_offsetLeft / canvasWidth) * imgWidth;
    const pY = (_offsetTop / canvasHeight) * imgHeight;

    if (magnifier) {
      const ctx = magnifier.getContext("2d");
      const img = document.getElementById(
        "sourceImg"
      ) as HTMLImageElement | null;
      if (img && ctx) {
        ctx.drawImage(
          img,

          // respect ratio after display in canvas
          // pX - (magnifierWidth * widthRatio) / 2 / Math.sqrt(magnifierScaleRatio),
          // pY - (magnifierHeight * heightRatio) / 2 / Math.sqrt(magnifierScaleRatio),
          // (magnifierWidth * widthRatio) / Math.sqrt(magnifierScaleRatio),
          // (magnifierHeight * heightRatio) / Math.sqrt(magnifierScaleRatio),

          // respect picture ratio
          pX - magnifierWidth / 2 / Math.sqrt(magnifierScaleRatio),
          pY - magnifierHeight / 2 / Math.sqrt(magnifierScaleRatio),
          magnifierWidth / Math.sqrt(magnifierScaleRatio),
          magnifierHeight / Math.sqrt(magnifierScaleRatio),

          0,
          0,
          magnifierWidth,
          magnifierHeight
        );
        drawLine(
          ctx,
          magnifierWidth / magnifierScaleRatio,
          magnifierHeight / magnifierScaleRatio
        );
      }
    }

    // ctx.drawImage;
  };

  const handleGetColor = () => {
    if (canvas) {
      const ctx = canvas.getContext("2d");
      if (ctx) {
        const [r, g, b, a] = Array.from(
          ctx.getImageData(_offsetLeft, _offsetTop, 1, 1)
            .data as Uint8ClampedArray
        );
        console.log("rgba:", r, g, b, a);
        document.body.style.backgroundColor = `rgba(${r}, ${g}, ${b}, ${a})`;
      }
    }
  };

  return (
    <div
      style={{
        position: "relative",
      }}
      onClick={handleGetColor}
    >
      <img
        id="sourceImg"
        src={imgBase64}
        onLoad={handleImageLoad}
        alt=""
        style={{
          display: "none",
        }}
      />
      <canvas
        id="c"
        width={canvasWidth}
        height={canvasHeight}
        style={{
          cursor: "crosshair",
        }}
        onMouseMove={handleMouseMove}
        onMouseEnter={() => setMagnifierVisible(true)}
        onMouseLeave={() => setMagnifierVisible(false)}
      ></canvas>
      <canvas
        id="magnifier"
        width={magnifierWidth}
        height={magnifierHeight}
        style={{
          position: "absolute",
          borderRadius: "50%",
          display: magnifierVisible ? "block" : "none",
          left: _offsetLeft || 0,
          top: _offsetTop || 0,
        }}
      ></canvas>
    </div>
  );
}

export default ScreenColorPicker;
